import React, { Fragment } from 'react';

export default function SignInForm() {
	return (
		<form className='form_signin'>
			<input className='form_signin-input' type='text' placeholder='Username' />
			<input
				className='form_signin-input'
				type='password'
				placeholder='*******'
			/>
		</form>
	);
}
